var convertData = function(data) {
    var res = [];
    for (var i = 0; i < data.length; i++) {
        var dataItem = data[i];
        var fromCoord = geoCoordMap[dataItem[0].name];
        var toCoord = geoCoordMap[dataItem[1].name];
        if (fromCoord && toCoord) {
            res.push({
                fromName: dataItem[0].name,
                toName: dataItem[1].name,
                coords: [fromCoord, toCoord],
                //value: dataItem[0].value,
                lineStyle: {
                    width: dataItem[0].value / 15,
                    opacity: dataItem[0].value / 150 //尾迹线条透明度
                }
            });
        }
    }
    return res;
};

var series = [];
[
    ["中国", BJData]
].forEach(function(item, i) {
    series.push({
            name: item[2],
            type: "lines",
            zlevel: 2,
            effect: {
                show: true,
                // color: "#ffffff",
                period: 0, //箭头指向速度，值越小速度越快

                trailLength: 0.05, //特效尾迹长度[0,1]值越大，尾迹越长重
                symbol: "arrow", //箭头图标
                symbolSize: 5 //图标大小
            },
            lineStyle: {
                normal: {
                    width: item[0].value, //尾迹线条宽度
                    opacity: 0.05, //尾迹线条透明度
                    curveness: 0.3 //尾迹线条曲直度
                }
            },
            label: {
                normal: {
                    show: false,
                    position: 'middle',
                    formatter: item[1].coords
                }
            },
            data: convertData(item[1])
        }, {
            type: "effectScatter",
            coordinateSystem: "geo",
            zlevel: 2,
            label: {
                normal: {
                    show: false,
                    position: "right", //显示位置
                    offset: [5, 0], //偏移设置
                    formatter: "{b}", //圆环显示文字
                    textStyle: {
                        color: "red"
                    }
                },
                emphasis: {
                    show: true
                }
            },
            symbol: "circle",
            symbolSize: function(val) {
                return 1 + val[2] / 1000; //圆环大小
            },
            itemStyle: {
                normal: {
                    show: false
                }
            },
            data: item[1].map(function(dataItem) {
                return {
                    name: dataItem[0].name,
                    value: geoCoordMap[dataItem[0].name].concat([dataItem[0].value])
                };
            })
        },
        //item[0]，特殊显示
        {
            type: "effectScatter",
            coordinateSystem: "geo",
            zlevel: 3,

            label: {
                normal: {
                    show: true,
                    position: "right",
                    color: "grey",
                    formatter: "{b}",
                    textStyle: {
                        color: "#00ffff"
                    }
                },
                emphasis: {
                    show: true
                }
            },
            symbol: "circle",
            symbolSize: 0,
            itemStyle: {
                normal: {
                    show: false,
                }
            },
            data: [{
                name: item[0],
                // concat([10000])决定图例的颜色
                value: geoCoordMap[item[0]].concat([10000])
            }]
        }
    );
});

